import React from "react"
import airplane from '../PaperAirplane.svg';

function Landing(props) {
    return (
        <div style={{flex: 1}} id="landing">
            <h1>Anneliese Wen</h1>
            <img align="right" id="img-airplane" src={airplane}/>
        </div>
    )
}

export default Landing;
